import React from "react";
import "./header.css";
import logo from "../logo.svg";
function header() {
  return (
    <>
      <div className="header">
        <div className="logo">
          <img src="../assests/logo192.svg" />
        </div>
        <div className="Title">SecureNet</div>
      </div>
    </>
  );
}

export default header;
